<html>
	<head>
		<title>Leaked TIET Student Data</title>
	</head>
	<style>
		.note {
			color: white;
		}
		body {
			background-color: #202020;
			display: flex;
			flex-direction: column;
			justify-content: center;
			align-items: center;
		}
		#search {
			border: none;
			outline: none;
			padding: 1rem;
			margin-top: 1rem;
			text-align: center;
			font-size: 2rem;
		}
		#filters {
			margin-top: 1rem;
			margin-bottom: 1rem;
			display: flex;
			flex-wrap: wrap;
		}
		.filter {
			padding: 0.5rem;
			margin: 0.5rem;
			color: white;
			font-size: 1.5rem;
			cursor: pointer;
		}
		.filter[data-selected="false"] {
			background-color: #101010;
		}
		.filter[data-selected="true"] {
			background-color: #55bf28;
		}
		#trigger_search {
			padding: 0.5rem;
			background-color: #101010;
			color: white;
			font-size: 2rem;
			border: none;
			outline: none;
			cursor: pointer;
			margin-bottom: 1rem;
		}
		#trigger_search:hover {
			background-color: #521dd6;
			font-size: 2rem;
			border: none;
			outline: none;
		}
		table {
			color: white;
			font-size: 1.5rem;
			width: 100%;
			border: 1px solid white;
			text-align: center;
		}
		tr {
			margin-top: 0.5rem;
			margin-bottom: 0.5rem;
		}
		tr:hover {
			background-color: #303030;
		}
	</style>
	<body>
		<div class="note">Information before 20th August</div>
		<input id="search" placeholder="Search Term" />
		<div id="filters">
				<div data-selected="true" class="filter">Name</div>
				<div data-selected="true" class="filter">Email ID</div>
				<div data-selected="true" class="filter">Phone No.</div>
				<div data-selected="true" class="filter">Application No.</div>
				<div data-selected="true" class="filter">Branch</div>
			</div>
		</div>
		<button id="trigger_search">Search</button>
		<table>
			<tr>
				<th>Name</th>
				<th>Email ID</th>
				<th>Phone No.</th>
				<th>Application No.</th>
				<th>Branch</th>
			</tr>
			<tbody id="output">
			</tbody>
		</table>
